import React, { useState } from 'react';
import './Search.css';

export default function Search(){
    const [activity, setActivity] = useState('')
    const getActivity = (e) => {
        setActivity(e.target.value)
    }
    const activities =  ["Hiking", "Boating", "Picnicking", "Birdwatching", "Off-Roading", "Camping","RV Camping","Biking","Fishing","Snorkeling","SCUBA Diving","Surfing","Geocaching","Wildlife Watching", "Horseback Riding","Museum Exhibits","Guided Tours"]
    return (
        <form className="search-form">

            <div className="activity-container">
            <select onChange={getActivity} className="activity-select" value={activity}>
                <option className="activity-option" value="Activity">Activity</option>
                <option className="activity-option" value="Camping">Camping</option>
            </select>
            </div>
            <button className="search-form-button">search</button>
        </form>
    )
}
